import React from "react";

function LoginLogo() {
  return (
    <section className="grid place-items-center">
      <div className="grid place-items-center max-w-[30rem] w-full relative">
        <img
          src="/images/background.svg"
          className="w-full h-full object-cover absolute top-0 z-0"
        />
        {/* Container */}
        <div className="flex flex-col items-center justify-center z-10 px-10 h-screen max-w-[30rem] w-full">
          {/* Logo */}
          <div>
            <img
              src="/images/HigherEducationLogo.svg"
              className="max-w-full h-auto"
            />
          </div>
          {/* title */}
          <p className="text-4xl text-white mt-3 text-center">PROJECT KARMA</p>
        </div>
      </div>
    </section>
  );
}

export default LoginLogo;
